import axios from 'axios'
import { ENDLOGINPOINT } from "../api/config/config"

type MethodType = 'get' | 'GET' | 'post' | 'POST'

interface RequestType {
    status: string
    data: any
    message: string
}

const API_NO_TOKEN = {
    request: async (method: MethodType, api: string, body?: object | undefined, formData?: any) => {

        let Authorization = 'not yet'

        try {
            console.log('ENDLOGINPOINT Info:', {
                ENDLOGINPOINT,
                method,
                Authorization,
                api,
                body,
                formData
            })

            return await axios({
                url: `${ENDLOGINPOINT}/${api}`,
                method,
                data: formData ? formData : body ? body : null
            })

        } catch (error) {
            console.log(`${api}에서 에러가 발생했습니다.`, error)
            return false
        }

    }
}
export default API_NO_TOKEN
